# Comments indicate points of this model file that changed compared to the previous examples. All other elements are not
# explained/described anymore. See also: 03_basic_two_nodes.yaml

config:
  general:
    version:
      core: 2.0.2
  optimization:
    problem_type: LP
    snapshots:
      count: 8760
    solver:
      name: highs
  results:
    enabled: true
    memory_only: true

# We consider a full-year planning horizon, so 8760 snapshots. This time we want IESopt to name them, since we do
# not have specific names and want an easy initialization. This will result int "t1" ... "t8760".

# A new carrier is used to track wind usage. If needed one could of course distinct "gas" and "electricity" using
# "MWh_primary" or "MWh_el" for example.
carriers:
  electricity: {unit: MWh}
  gas: {unit: MWh}
  co2: {unit: t}
  wind: {unit: MWh}

components:
  node1:
    type: Node
    carrier: electricity
  
  node2:
    type: Node
    carrier: electricity
    has_state: true
    state_lb: 0
    state_ub: 10

  conn:
    type: Connection
    capacity: 5
    node_from: node1
    node_to: node2

  # To better track the results, model wind usage using a Profile.
  availability:
    type: Profile
    mode: create
    carrier: wind
    node_to: wind

  wind:
    type: Node
    carrier: wind
  
  plant_wind:
    type: Unit
    inputs: {wind: wind}
    outputs: {electricity: node2}
    conversion: 1 wind -> 1 electricity
    capacity: 10 out:electricity
